Difficulty=5
', 'If $ae^{bt}=c$, where $a$, $b$, and $c$ are positive, then $t$ equals what? %Alg2 Regents Jan2018 multiple choice

', 'What is the solution to $8(2^{x+3})=48$? %Alg2 Regents Jun2017 multiple choice

', 'To the \emph{nearest tenth}, what is the value of $x$ that satisfies $2^x=-2x+11$? %Alg2 Regents Aug2016 MC

Calc=2
', 'For which values of $x$, rounded to the \emph{nearest hundredth}, will $|x^2-9|-3= \log_3 x$?  %Alg2 Regents Jan2018 multiple choice

', 'When $\displaystyle g(x)= \frac{2}{x+2}$ and $h(x)=\log (x+1) +3$ are graphed on the same set of axes, what coordinate pair represents their point of intersection? %Alg2 Regents Jan2017 multiple choice

', 'If $f(x)=3|x| -1$ and $g(x)= 0.03x^3 -x +1$, an approximate solution for the equation $f(x)= g(x)$ is
