', '\subsubsection*{Topic="Experimental design - not actual category"\\
Source="Regents" 
Difficulty=4 
Calc=1}

', 'Which statement about statistical analysis is \emph{false}?
\begin{enumerate}
    \item Experiments can suggest patterns and relationships in data.
    \item Experiments can determine cause and effect relationships.
    \item Observational studies can determine cause and effect relationships.
    \item Observational studies can suggest patterns and relationships in data.
\end{enumerate} %Alg2 Regents Jan2017 MC

', 'Describe how a controlled experiment can be created to examine the effect of ingredient $X$ in a toothpaste. %Regents Jun2016
%A correct description of a controlled experiment is written, such as indicating two randomly assigned groups, one with ingredient X and one without ingredient X. ("control group, randomly assigned, with/without")

', 'An orange-juice processing plant receives a truckload of oranges. The quality control team randomly chooses three pails of oranges, each containing 50 oranges, from the truckload. Identify the sample and the population in the given scenario.\\[1.5in]
State \emph{one} conclusion that the quality control team could make about the population if 5\% of the sample was found to be unsatisfactory. %Alg2 Regents Jan2017

', '\subsubsection*{Topic="Probability of Compound Events"\\
Source="IB" 
Difficulty=4 
Calc=1}

', 'Two events $A$ and $B$ are such that $P(A)=0.2$ and $P(A \cup B) =0.5$. 
\begin{enumerate}
    \item Given that $A$ and $B$ are mutually exclusive, find $P(B)$.
    \item Given that $A$ and $B$ are independent, find $P(B)$.
\end{enumerate}

', 'Given events $A$ and $B$, such that $P(A)= 0.6$, $P(B) = 0.5$, and $P(A \cup B)=0.8$, determine whether $A$ and $B$ are independent or dependent. %Regents Alg2 Aug2016

', 'Seanâ€™s team has a baseball game tomorrow. He pitches 50\% of the games. There is a 40\% chance of rain during the game tomorrow. If the probability that it rains given that Sean pitches is 40\%, it can be concluded that these two events are
\begin{enumerate}
    \item independent
    \item dependent
    \item mutually exclusive
    \item complements
\end{enumerate} %Regents Alg2 Jun2016 MC

', 'The probability that Gary and Jane have a child with blue eyes is 0.25, and the probability that they have a child with blond hair is 0.5. The probability that they have a child with both blue eyes and blond hair is 0.125. Given this information, the events blue eyes and blond hair are\\*
.\qquad I: dependent\\*
.\qquad II: independent\\*
.\qquad III: mutually exclusive\\* %Alg2 Regents Jun2017 multiple choice

', 'Data collected about jogging from students with two older siblings are shown in the table below.\\*[5pt]
\begin{tabular}{|c|c|c|c|}
\hline 
& Neither Sibling & One Sibling & Both Siblings\\ 
& Jogs & Jogs & Jogs\\\hline 
Student Does Not Jog & 1168 & 1823 & 1380 \\ 
\hline 
Student Jogs & 188 & 416 & 400 \\ 
\hline 
\end{tabular}\\*[5pt]
Using these data, determine whether a student with two older siblings is more likely to jog if one sibling jogs or if both siblings jog. Justify your answer. %Alg2 Regents Jun2017

', 'A student is chosen at random from the student body at a given high school. The probability that the student selects Math as the favorite subject is $\frac{1}{4}$. The probability that the student chosen is a junior is $\frac{116}{459}$. If the probability that the student selected is a junior or that the student chooses Math as the favorite subject is $\frac{47}{108}$, what is the exact probability that the student selected is a junior whose favorite subject is Math?\\*[15pt]

Are the events ``the student is a juniorâ€ and ``the studentâ€™s favorite subject is Mathâ€ independent of each other? Explain your answer. %Alg2 Regents Jan2018

', '\subsubsection*{Topic="Conditional Probability"\\
Source="IB" 
Difficulty=5 
Calc=1}

', 'Given events $A$ and $B$, such that $\mathrm \mathrm P(A)=0.6, \mathrm P(B)=0.5$, and $\mathrm P(A \cup B) =0.8$, determine whether $A$ and $B$ are dependent or independent. Justify your answer.

Difficulty=6 
', 'A study was designed to test the effectiveness of a new drug. Half of the volunteers received the drug. The other half received a sugar pill. The probability of a volunteer receiving the drug and getting well was 40\%. What is the probability of a volunteer getting well, given that the volunteer received the drug? %Alg2 Regents Aug2017

', '\subsubsection*{Topic="Normal Distributions"\\
Source="IB" 
Difficulty=4 
Calc=2}

', 'The random variable $X$ is normally distributed with mean 20 and standard deviation 5. 
\begin{enumerate}
    \item Find $P(X \leq 22.9)$.
    \item Given that $P(X < k) = 0.55$, find the value of $k$.
\end{enumerate}

Source="Regents" 
Difficulty=4 
Calc=2

', 'There are 440 students at Thomas Paine High School enrolled in U.S. History. On the April report card, the studentsâ€™ grades are approximately normally distributed with a mean of 79 and a standard deviation of 7. Students who earn a grade less than or equal to 64.9 must attend summer school. Approximately how many students must attend summer school for U.S. History?

', 'A suburban high school has a population of 1376 students. The number of students who participate in sports is 649. The number of students who participate in music is 433. If
the probability that a student participates in either sports or music is $\displaystyle \frac{974}{1376}$, what is the probability that a student participates in both sports and music? %Alg2 Regents Jun2016

', '\subsubsection*{Topic="Using Trigonometry to Find Area"\\
Source="IB" 
Difficulty=4 
Calc=2}

', 'The area of triangle ABC is 80 sq. cm, AB = 18 cm, AC = $x$ cm and B\^AC = $50^\circ$. Find $x$.


', '\subsubsection*{Differentiate each function.}

', '$f(x)=2x^3-x^2+6$
