    \begin{flushright}[6]\end{flushright}

', 'The first three terms of a geometric sequence are $\ln{x^16}$, $\ln{x^8}$, $\ln{x^4}$, for $x>0$.\\
\begin{enumerate}
    \item Find the common ratio.
        \begin{flushright}[3]\end{flushright}
    \item Solve $\displaystyle \sum_{k=1}^{\infty} 2^{5-k} \ln x =64$.
        \begin{flushright}[5]\end{flushright}
    \end{enumerate}

', 'The first two terms of an infinite geometric sequence, in order, are $2 \log_2{x}$, $\log_2{x}$, where $x>0$.\\
