        \item Simplify, beginning each line with a leading equals sign if it is equal to the line above.
    \end{enumerate}
', 'Given $f(x)=x^2-1$. Simplify $f(2x-1)$
', 'Given $f(x)=x^3$. Simplify $f(x+1)$
