      \item Find $f + g$
      \item Find $f \times g$
      \item Find $f \div g$
  \end{enumerate}

', '\newpage
', '\subsubsection*{The inverse of a function}

', 'Given $f(x)=3x+2$. What is the inverse of the function $f^{-1} (x)$?

