      \item State the answer as $f^{-1} (x)$ equals an expression.\\*[15pt]
  \end{enumerate}

  Derive the inverse of each function. Simplify the expression.
', '  $f(x)=\frac{1}{2}x+2$
', '  $f(x)=\frac{2}{3}x^2-3$
', '  $f(x)=\sqrt{x-1}+\frac{1}{2}$

']

