\begin{enumerate}
    \item Express $f$ in fully factored form.\\[40pt]
    \item What are the roots of the function?\\[30pt]
\end{enumerate}


', 'Simplify $2i(-4-7i)$. Express the result in the form $a+bi$ where $a,b \ \epsilon \ R$.\\[30pt]

', 'Simplify the expression $5xi(1-2i)$.\\*[20pt]


', '\newpage

', 'When $g(x)$ is divided by $x+4$, the remainder is 0. Given $g(x)=x^4+3x^3- 6x^2- 6x-8$. Write down the value of $g(-4)$.\\*[15pt]

', 'Simplify the expression $\sqrt{x^3} \cdot \sqrt{x^5}$ \\*[30pt]

', 'Simplify the expression $\displaystyle \left( \frac{27x^{5}y^3}{8x^2} \right)^{\frac{2}{3}}$ to one with positive integer exponents and radicals.\\*[40pt]


', '\newpage

', 'Graph $\displaystyle g(x)= 115(1.07)^ {\frac{7x}{4}} -45$ on the set of axes below.
