', '
', '
', '  \end{enumerate}
']

problems_list:
['    \subsubsection*{5.0 Calculator practice: Linear regression, systems of equations, cosine rule, frequency table statistics}

', 'Apply the law of cosines, $c^2=a^2+b^2-2ab \cos \theta$.
    \begin{enumerate}
        \item $a=22.5$, $b=15.7$, $\theta = 110^\circ$. Find the third side length, $c$. \hfill [3]
        \item $a=8.4$, $b=7.2$, $c=13.0$. Find the angle measure, $\theta$. \hfill [3]
    \end{enumerate}
        \begin{tikzpicture}
            \draw (0,0) rectangle (15.2,5);
            \draw (8,0) rectangle (15.2,3);
            \node at (0,5)[below right]{\textbf{Working:}};
            \node at (8,3)[below right]{\textbf{Answers:}};
            \draw [dotted] (9,1.7)node[left]{(a)}--(15,1.7);
            \draw [dotted] (9,1)node[left]{(b)}--(15,1);
        \end{tikzpicture}

', 'Perform a linear regression on the data in the table, finding $y=ax+b$. 
            \begin{center}
            \begin{tabular}{|l|c|c|c|c|c|c|c|}
                \hline
                $x$ & 14 & 15 & 13 & 16 & 19 & 11 & 13 \\ 
                \hline 
                $y$ & 51.1 & 58.7 & 49.2 & 63.2 & 71.5 & 45.7 & 48.4 \\ 
                \hline 
                \end{tabular}
            \end{center}
            \begin{enumerate}
                \item Write down the value of $a$, $b$, and $r$. \hfill [3]
                \item Characterize the correlation coefficient. \hfill [1]
                \item Use your regression line to estimate $y$ for $x=19$. \hfill [2]
            \end{enumerate}
            \begin{tikzpicture}
                \draw (0,0) rectangle (15.2,7);
                \draw (8,0) rectangle (15.2,4);
                \node at (0,7)[below right]{\textbf{Working:}};
                \node at (8,4)[below right]{\textbf{Answers:}};
                \draw [dotted] (9,2.4)node[left]{(a)}--(15,2.4);
                \draw [dotted] (9,1.7)node[left]{(b)}--(15,1.7);
                \draw [dotted] (9,1)node[left]{(c)}--(15,1);
            \end{tikzpicture}

', '\newpage
', 'Find the solutions for the system, the value(s) for $x$ such that $f(x)=g(x)$. Sketch the graph to show working.
    \begin{enumerate}
        \item $f(x)=x^2-6x+10$ \\[0.25cm] $y=\frac{3}{2}x+1$ \hfill [3] \vspace{0.3cm}
    \end{enumerate}
        \begin{tikzpicture}
            \draw (0,0) rectangle (15.2,8);
            \draw (8,0) rectangle (15.2,3);
            \node at (0,8)[below right]{\textbf{Working:}};
            \node at (8,3)[below right]{\textbf{Answers:}};
            \draw [dotted] (9,1.7)node[left]{(a)}--(15,1.7);
            %\draw [dotted] (9,1)node[left]{(b)}--(15,1);
        \end{tikzpicture}

', 'The data for  $n=40$ are shown in the frequency table below.
    \begin{center}
        \begin{tabular}{|l|c|c|c|c|}
            \hline
            Mark ($x$) & $10 \leq x < 30$ & $30 \leq x < 50$ & $50 \leq x < 70$ & $70 \leq x < 90$\\ 
            \hline 
            Frequency & 7 & 13 & 17 & $k$\\ 
            \hline 
            \end{tabular}
    \end{center}
    \begin{enumerate}
        \item Find the value of $k$.  \hfill [1]
        \item Estimate the mean $\overline{x}$. \hfill [2]
        \item Estimate the standard deviation of the data, $\sigma$.  \hfill [2]
        \end{enumerate}
    \begin{tikzpicture}
        \draw (0,0) rectangle (15.2,5);
        \draw (8,0) rectangle (15.2,4);
        \node at (0,5)[below right]{\textbf{Working:}};
        \node at (8,4)[below right]{\textbf{Answers:}};
        \draw [dotted] (9,2.4)node[left]{(a)}--(15,2.4);
        \draw [dotted] (9,1.7)node[left]{(b)}--(15,1.7);
        \draw [dotted] (9,1)node[left]{(c)}--(15,1);
    \end{tikzpicture}

']

