['The expression $(x + a)(x + b)$ can not be written as
\begin{enumerate}
    \item $a(x + b)+ b(x + b)$
    \item $x^2 + ax + bx + ab$ 
    \item  $x^2 + (a + b)x + ab$  
    \item $x(x + a)+ b(x + a)$
\end{enumerate}

', '
\begin{enumerate}
    \item What is the quotient and the remainder when $f(x)=3x^3+8x^2+7x+3$ is divided by $x+2$?\\*[5in]
    \item Given your answer to part (a), what is the value of $f(-2)$?
\end{enumerate}

', 'A manufacturing company has developed a cost model, $C(x)=0.15x^3+0.01x^2+2x+120$, where $x$ is the number of items sold, in thousands. The sales price can be modeled by $S(x)=30-0.01x$. Therefore, revenue is modeled by $R(x)=x \cdot S(x)$.\\*[5pt]
The companyâ€™s profit, $P(x)=R(x)-C(x)$, could be modeled by what polynomial?  %Alg2 Regents Jun2017 multiple choice

', '\newpage

', 'A bank account earns interest at a continuous interest rate of 3.925\% per year. The initial deposit is \$175. Which function models the value of the balance?
\begin{enumerate}
    \item $P(t)=175 \cdot 1.04^{t}$
    \item $P(t)=175 (1+0.03925)^{t}$
    \item $P(t)=175 \cdot 1.03925^{t}$
    \item $P(t)=175 \cdot e^{0.04t}$
\end{enumerate}

