    $f(0)=1$
\item Using the graph, solve for $f(x)= \frac{1}{4}$.\\*
    $f(2)= \frac{1}{4}$, therefore $x=2$
\item What is the value of $f^{-1}(8)$?\\*
    $f^{-1}(8)=-3$
