    \item $\ln 63$
    \item $\ln 9$
\end{enumerate}

', 'Using the quadratic formula or otherwise, find the solution set to $2x^2-5x-3=0$.

', 'Simplify the complex expression $3ai(3-2i)$.

', 'Simplify the expression $\displaystyle \left( \frac{x^{-3}}{x^5} \right)^{\frac{1}{4}}$ to one with positive integer exponents and radicals.

', '\newpage
