problems_list:
["Let $f(x)=\cos 2x$ and $g(x)=\ln (3x-5)$.
\begin{enumerate}
  \item Find $f'(x)$.
  \item Find $g'(x)$.
  \item Let $h(x) = f(x) \times g(x)$. Find $h'(x)$.
\end{enumerate}

", 'Consider the curve with equation $f(x) = px^2 + qx$, where $p$ and $q$ are constants. The point A(1, 3) lies on the curve. The tangent to the curve at A has gradient 8. Find the value of $p$ and of $q$.

', "The values for $f(x)$, $g(x)$, and their derivatives when $x=2$ and $x=5$ are given in the table. \\[0.5cm]
\begin{tabular}{|c|c|c|c|c|}
  \hline
  $x$ & $f(x)$ & $f'(x)$ & $g(x)$ & $g'(x)$ \\
  \hline
  2 & 3 & 2 & 5 & -2 \\
  \hline
  5 & -1 & 4 & 2 & 3 \\
  \hline
\end{tabular}\\[0.5cm]
Let $h(x)=f(x)g(x)$
\begin{enumerate}
  \item Find $h(2)$.
  \item Find $h'(5)$.
\end{enumerate}

", 'A farmer wishes to create a rectangular enclosure, ABCD, of area 525 $m^2$, as shown below.
  \begin{figure}[!htbp]
    \begin{center}
    \begin{tikzpicture}
      \draw [thick, -] (-3,3) -- (3,3) node [right] {$C$};
      \draw [thick, -] (3,0) -- (-3,0) node [left] {$A$};
      \draw [thick, -] (-3,0) -- (-3,3) node [left] {$D$};
      \draw [thick, -] (3,3) -- (3,0) node [right] {$B$};
    \end{tikzpicture}
    \end{center}
  \end{figure}
  The fencing used for side AB costs \$11 per metre. The fencing for the other three sides costs \$3 per metre. The farmer creates an enclosure so that the cost is a minimum. Find this minimum cost.

', 'In an arithmetic sequence, $S_{40} =1900$ and $u_{40} =106$. Find the value of $u_1$ and of $d$.

', '\newpage

', 'Let $\displaystyle f(x) = 5 \cos \frac{\pi}{4} x$ and $g(x)= -0.5 x^2 +5x-8$, for $0 \leq x \leq 9$.
  \begin{enumerate}
    \item On the same diagram, sketch the graphs of $f$ and $g$.
    \item Consider the graph of $f$ . Write down
      \begin{enumerate}
      \item the x-intercept that lies between $x = 0$ and $x = 3$;
      \item the period;
      \item the amplitude.
      \end{enumerate}
    \item Consider the graph of $g$. Write down
      \begin{enumerate}
      \item the two $x$-intercepts;
      \item the equation of the axis of symmetry.
      \end{enumerate}
  \end{enumerate}

']

